import React, { useState } from 'react';
import { View, Text, TouchableOpacity } from 'react-native';

export default function MyComponent() {
  const [textColor, setTextColor] = useState('black'); // State variable for text color

  const changeTextColor = () => {
    // Update the state variable to change text color
    setTextColor('red');
  };

  return (
    <View>
      <Text style={{ color: textColor }}>This is some text</Text>
      <TouchableOpacity onPress={changeTextColor}>
        <Text>Change Text Color</Text>
      </TouchableOpacity>
    </View>
  );
}
